import Component1 from "./Component1";
import './LargeComponent.css'

function LargeComponent(props){
    return(
        <div className="LargeComponent">
            <Component1 
                date = {props.date0}
                title = {props.title0}
                price = {props.price0}/>
            <Component1 
                date = {props.date1}
                title = {props.title1}
                price = {props.price1}/>
            <Component1 
                date = {props.date2}
                title = {props.title2}
                price = {props.price2}/>
            <Component1 
                date = {props.date3}
                title = {props.title3}
                price = {props.price}/>
            <Component1 
                date = {props.date}
                title = {props.title}
                price = {props.price}/>
        </div>
    );
}

export default LargeComponent;
